  const generateLink = (type, data, extra, resourceType) => {
    const {
      query, params, path, total, result, hasNextPage
    } = extra;
    const paginationConfigurations = {
      type,
      query,
      path
    };
    if (data === null) {
      return null;
    }
    if (type === 'before') {
      paginationConfigurations.resource = data[0];
    } else if (type === 'after') {
      paginationConfigurations.resource = data[data.length - 1];
    }
    const retrievingOneResource = params && params.uuid;
    const retrievingAllResources = total === result;
    if (!retrievingOneResource && !retrievingAllResources) {
      return buildPaginationLink(paginationConfigurations, resourceType);
    }
    return null;
  };

